import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  width: 100%;
  height: 585px;
  background-color: #47d99b;
  & > div {
    width: 993px;
    height: 100%;
    margin: 0 auto;
  }
`;
function SnsSection() {
  return (
    <Wrapper>
      <div>
        <div className="logo">SNS</div>
        <div className="title">김과장 컨설팅 SNS</div>
      </div>
    </Wrapper>
  );
}

export default SnsSection;
